import React, { useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";

export default function Navbar({ user, setUser }) {
  const [search, setSearch] = useState("");
  const [showModal, setShowModal] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  function handleLogout() {
    setUser(null);
    localStorage.removeItem("lastUser");
    navigate("/");
  }

  // Example: search will be handled on Inventory/Transfer by passing query state (left as extension for now)
  function handleSearch(e) {
    e.preventDefault();
    if (location.pathname !== "/inventory") navigate("/inventory");
    // Could pass query as param or use global state
  }

  return (
    <>
      <div className="navbar-bar">
        <div className="navbar-inner">
          <span className="navbar-title" onClick={() => navigate("/inventory")}>Rares</span>
          <div className="navbar-links">
            <NavTab label="INVENTORY" to="/inventory" active={location.pathname==="/inventory"} onClick={() => navigate("/inventory")} />
            <NavTab label="TRANSFER" to="/transfer" active={location.pathname==="/transfer"} onClick={() => navigate("/transfer")} />
            <NavTab label="ABOUT" to="/about" active={location.pathname==="/about"} onClick={() => navigate("/about")} />
          </div>
          <form className="navbar-search" onSubmit={handleSearch}>
            <input
              className="search-input"
              type="text"
              placeholder="Search..."
              value={search}
              onChange={e => setSearch(e.target.value)}
            />
            <button className="search-btn" type="submit">SEARCH</button>
          </form>
          <span className="navbar-account" onClick={() => setShowModal(true)}>ACCOUNT</span>
          <span className="navbar-logout" onClick={handleLogout}>LOG OUT</span>
        </div>
      </div>
      {showModal && (
        <div className="account-modal-bg" onClick={() => setShowModal(false)}>
          <div className="account-modal" onClick={e => e.stopPropagation()}>
            <h3 style={{margin:0, marginBottom:12, fontWeight:600}}>Account Info</h3>
            <div><b>CNP:</b> {user.cnp}</div>
            <div><b>Address:</b> {user.address}</div>
            <div style={{marginTop:16}}>
              <button onClick={() => setShowModal(false)} className="button-main">Close</button>
            </div>
          </div>
        </div>
      )}
      <style>{`
        .navbar-bar {
          position: sticky; top: 0; z-index: 12;
          background: #f5f5f3;
          border-bottom: 1.5px solid #ededed;
          box-shadow: 0 2px 12px #0002;
        }
        .navbar-inner {
          max-width: 1400px;
          margin: 0 auto;
          display: flex; align-items: center;
          gap: 26px;
          height: 60px;
          padding: 0 30px;
        }
        .navbar-title {
          font-size: 2.1rem;
          font-weight: 700;
          letter-spacing: .13em;
          color: #64625f;
          margin-right: 22px;
          cursor: pointer;
        }
        .navbar-links {
          display: flex; gap: 17px; margin-right: 50px;
        }
        .navbar-account, .navbar-logout {
          margin-left: 32px;
          font-weight: 600; color: #64625f;
          cursor: pointer; font-size: 1.1rem;
          letter-spacing: .03em;
          transition: color .14s;
        }
        .navbar-account:hover, .navbar-logout:hover {
          color: #171716;
        }
        .navbar-search {
          margin-left: auto;
          display: flex; align-items: center;
          gap: 0;
          position: relative;
        }
        .search-input {
          border: 1px solid #e0e0e0;
          border-radius: 6px 0 0 6px;
          padding: 7px 13px;
          font-size: 1.01rem;
          background: #fff;
          min-width: 120px;
          outline: none;
          transition: box-shadow .17s;
        }
        .search-input:focus {
          box-shadow: 0 2px 8px #06b6d41d;
          border-color: #5eead4;
        }
        .search-btn {
          border: 1px solid #e0e0e0;
          background: #f0f3fa;
          color: #64625f;
          padding: 7px 14px;
          border-radius: 0 6px 6px 0;
          font-weight: 700;
          letter-spacing: .03em;
          cursor: pointer;
          transition: background .12s;
        }
        .search-btn:hover {
          background: #e0e7ff;
        }
        .account-modal-bg {
          position: fixed; top: 0; left: 0; width: 100vw; height: 100vh;
          background: #0002;
          display: flex; align-items: center; justify-content: center;
          z-index: 999;
        }
        .account-modal {
          background: #fff;
          border-radius: 16px;
          min-width: 320px;
          box-shadow: 0 8px 32px #4f46e50a, 0 2px 16px #0001;
          padding: 32px 24px 18px 24px;
        }
      `}</style>
    </>
  );
}

function NavTab({ label, to, active, onClick }) {
  return (
    <span
      className={`navbar-tab${active ? " navbar-tab-active" : ""}`}
      onClick={onClick}
      tabIndex={0}
      style={{ outline: "none" }}
    >
      {label}
      <style>{`
        .navbar-tab {
          font-size: 1.09rem;
          font-weight: 600;
          padding: 7px 17px 7px 17px;
          border-radius: 11px;
          color: #64625f;
          background: none;
          cursor: pointer;
          margin-right: 6px;
          transition: background .18s, color .18s;
          outline: none;
        }
        .navbar-tab-active {
          background: #e0e7ff;
          color: #3730a3;
        }
        .navbar-tab:focus {
          box-shadow: 0 2px 10px #22d3ee1a;
        }
      `}</style>
    </span>
  );
}
